import React from 'react';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css';
import slide1 from "../assets/slide1.jpg";

const slideImages = [
    {
        url: 'https://www.bing.com/images/search?view=detailV2&ccid=iSu2RcCc&id=3371926A1EC4104FE06103E824E79A46BD9C59B2&thid=OIP.iSu2RcCcdm78xbxNDJMJSgHaEo&mediaurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.892bb645c09c766efcc5bc4d0c93094a%3frik%3dslmcvUaa5yToAw%26riu%3dhttp%253a%252f%252fwww.wallpapers13.com%252fwp-content%252fuploads%252f2015%252f12%252fNature-Lake-Bled.-Desktop-background-image.jpg%26ehk%3dc2raFC95S12P3OL0%252fwdM60ro3oUxsSEajkuGEN%252fsjbo%253d%26risl%3d1%26pid%3dImgRaw%26r%3d0&exph=1600&expw=2560&q=image&simid=607997022278547566&form=IRPRST&ck=21A10CAB5FE32D5B2F6EBB61CA87F02B&selectedindex=0&ajaxhist=0&ajaxserp=0&first=1&tsc=ImageBasicHover',
        caption: 'Slide 1'
    },
    {
        url: "../assets/slide2.jpg",
        caption: 'Slide 2'
    },
    {
        url: "../assets/slide3.jpg",
        caption: 'Slide 3'
    },
];

const Slideshow = () => {
    return (
        <div className="slide-container">
            <Slide>
                {slideImages.map((slideImage, index) => (
                    <div className="each-slide" key={index}>
                        <div style={{ 'backgroundImage': `url(${slideImage.url})` }}>
                            <span>{slideImage.caption}</span>
                        </div>
                    </div>
                ))}
            </Slide>
        </div>
    )
}
export default Slideshow;
